export async function LoadAllData(){
    const dispatch = useDispatch();
    const AllRes = await FetchAllData('http://localhost:3001/api/restaurants/getRestaurants');
    console.log(AllRes);
    store.dispatch(setRestaurants(AllRes));
    const ress = useSelector((state:any) => state.restaurants.value);
    ress.map((a:any)=>console.log(a));

}
